import React, { useEffect, useState } from "react";
import { Paper,TableContainer,Table,TableHead,TableRow,TableCell,TableBody, TablePagination } from "@material-ui/core";

import useStyle from "./styles";



  const Dashboard = () => {
  const classes = useStyle();
  const [ data, setData ] = useState <any[]>([]);

  const item = { cve: { CVE_data_meta: { ID: 'number' }, description: { description_data: { value: " string" }}},  impact: { severity: "string" }, publishedData: "number"} 

  useEffect( () => {
    fetch('http://localhost:5000/data')
    .then(response =>  response.json())
    .then (resData => setData(resData.data)) 

  },[]);




  console.log(data)
  return (
    <Paper className={classes.root}>
      <TableContainer className={classes.container}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
          {data.map(item =>
               <TableCell >
                  {item.publishedDate}         
               </TableCell>
            )}

          </TableHead>
          <TableBody>

          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
};

export default Dashboard;
